def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if ratios[i] < 0.5:
            priorities[i] = np.power(np.sin(item) + np.cos(bins[i]), 2)
        else:
            priorities[i] = np.exp(np.sqrt(item * bins[i])) + np.log(item + bins[i])

    for j in range(len(bins)):
        if priorities[j] < 5:
            priorities[j] *= 1.5
        elif priorities[j] >= 5 and priorities[j] < 10:
            priorities[j] *= 2
        elif priorities[j] >= 10 and priorities[j] < 15:
            priorities[j] /= 2
        else:
            priorities[j] = np.sqrt(priorities[j])

    for k in range(len(bins)):
        if priorities[k] % 2 == 0:
            priorities[k] += item
        else:
            priorities[k] -= item / 2

        if item > 15:
            priorities[k] *= 1.5
        else:
            priorities[k] = np.exp(priorities[k])

    return priorities
